import React, { Component } from 'react';
import axios from 'axios';

export default class GetCars extends Component {

    componentDidMount() {
    };



    render() {
        return (
            <div className="row">
                <div className="col-md-4">
                    <div className="card card-body">
                        <h3>
                            Get All Cars
                        </h3>
                        <form>
                            <div class="form-group">
                                <label for="exampleInputEmail1">Start Date</label>
                                <input type="date" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" />
                            </div>
                            <div class="input-group date" data-provide="datepicker"  data-date-format="mm/dd/yyyy">
                                <input type="text" className="form-control" />
                                <div className="input-group-addon">
                                    <span className="glyphicon glyphicon-th"></span>
                                </div>
                            </div>
                            <div className="form-group">
                                <label for="exampleInputPassword1">Password</label>
                                <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password" />
                                <small id="emailHelp" className="form-text text-muted">Type the start and end date so we can show you the cars</small>
                            </div>
                            <button type="submit" className="btn btn-primary">Submit</button>
                        </form>
                    </div>
                </div>
            </div>
        )
    };
}
